    <section className="container border border-5">
      <div className="row">
        {letters.map((l, k) => {
          if (k == 0) {
            return (
              <div className="col text-center"> {numbers[k]}</div>
            )
          } else {
            return (
              <div className="col text-center"> {l}</div>
            )
          }

        })}
      </div>
    </section>
  );
}

export default App;
